import { applyCfRuleDxf } from './applyCfRuleDxf.js';

/**
 * 不包含文本
 */
function notContainsText(sheet, cellInfo, cfRule) {
    if (!cfRule.text) {
        return false;
    }
    if (!cellInfo.value.includes(cfRule.text)) {
        applyCfRuleDxf(cfRule, sheet, cellInfo);
        return true;
    }
    return false;
}

export { notContainsText };
